import React from "react";
import styled from "styled-components";
import { PatchModal } from "./patch-modal/order";

const Container = styled.div`
  width: 100%;
  min-height: 100vh;
  background: #F0F1F3;
`;


export const PastorPage: React.FC = () => {
  return (
    <Container>
      <div style={{ background: "#F0F1F3", paddingTop: "54px" }}></div>
      <PatchModal />
    </Container>
  );
};
